('Herman den Blijker', 'Boerenkool met worst, Bereidingstijd: 30 min, Recept voor: 2 personen\r\n', 'Boerenkool met worst', '500 gr kruimige aardappels, 1 rookworst, 100 gram spekblokjes/reepjes, Snufje zout en peper, Scheutje azijn', 'Schil de aardappels en snijd grote aardappels in tweeën.', 'Doe de boerenkool en aardappels in een pan en voeg water toe totdat alles goed onderstaat. Breng het geheel aan de kook en kook de aardappels en boerenkool ongeveer 20 minuten totdat de aardappels gaar zijn.', 'Bereid de rookworst volgens de verpakking. Zelf kook ik de rookworst mee in de pan met de aardappels en boerenkool.', 'Bak ondertussen in een andere pan de spekblokjes bruin en krokant, zonder olie toe te voegen.', 'Na ongeveer 20 minuten zijn de aardappels gaar, en giet je het geheel af. Stamp de aardappels met de boerenkool, een snufje zout en peper, azijn en de boter fijn (evt. kun je de azijn ook weglaten). Als de stamppot nog wat te droog is, voeg je een beetje extra boter of wat melk toe.', 'Schep als laatste de spekblokjes (met het vet) door de boerenkool stamppot en serveer het geheel met de rookworst.\r\n\r\nSchep als laatste de spekblokjes (met het vet) door de boerenkool stamppot en serveer het geheel met de rookworst.', '', '', '', '', '2023-09-21', 'voor 2 personen', '30 minuten', '4oCwUE5HDQoaCgAAAA1JSERSAAAAw70AAADDgQgGAAAABMKNwrYqAAAAAXNSR0IAwq7DjhzDqQAAAARnQU1BAADCscKPC8O8YQUAAAAJcEhZcwAAFiUAABYlAUlSJMOwAADDv8KlSURBVHhew6zDvcO3X1V5xb7DrcKPw58_ZcKmwrtnwrrCq-KAnFUqSsOOOcOnHCXDpyRIEuKAmMKg4oKsw6TFk3MQJElGwrLLhsKBKEFAwqLigKLDs3RPdcKow67CuT_CrMOvesOvw4NRwrTCsMKrwrpnw67DnMO7w71Mw73CsB7Du3DDjj7igJjDvXzCrcO1esOvw7fDnsO7fx1-w7Etxb3CvsO8C17Fk8OUV8O_QcO9b8K8w7jDuuKAnsOEw58_w6rCv18vf8O_w7_DoMO_w6nCrzjDvMOiLzjCoMK2PsO-C8OGV8K_QsOlw501XMKvxb5FVMO-OCLDsiYRfHMMXkl9cOKAucOr4oCac8OsHThRxb3CscOdVA8cwrjCtMKPw6nigJ59w6zCsS53UMK3YR_DlSbDiS7CosOlWMO8O8Kiwp0SwrfDq2AVXAbDg0vDqcOQdk_igqxlcDoic-KAulB3dxJjCxt4w7TDrAjigLnDmy_CsMO4w6zigKLigJPCtz7DhMOKw7ZHWMOdw7kYT8W4f0LigLDDpcOHWMO