INSERT INTO `receptenboek` (`schrijver`, `Titel`, `recept_titel`, `receptIngredienten`, `recept_stap_1`, `recept_stap_2`, `recept_stap_3`, `recept_stap_4`, `recept_stap_5`, `recept_stap_6`, `recept_stap_7`, `recept_stap_8`, `recept_stap_9`, `recept_stap_10`, `datum`, `recept_voor_aantal_personen`, `bereidingstijdrecept`, `RECEPTFOTO1`, `receptfoto2`, `gemiddelde_review_score_recept`, `maximaal_aantal_calorieen`, `id`) VALUES
('Ron Blaauw', 'Pasta Carbonara', 'Pasta Carbonara minuten klaar', '400 gram spaghetti.\r\nverse peterselie.\r\n100 gram Parmezaanse kaas (geraspt).\r\n3 eieren.\r\nsnuf peper en zout.', '1. Doe de spekblokjes in een pan en bak ze mooi krokant. Ze hoeven niet helemaal uitgebakken te worden.', 'twee Zet ondertussen een grote pan water met een snufje zout op het vuur en als het water kookt voeg je de spaghetti toe. Kook de spaghetti in ongeveer 10 min al dente (of check de verpakking voor de bereidingswijze).', 'drei\r\n\r\nVoeg de pasta direct uit de pan waarin je het hebt gekookt toe aan de pan met spekjes toe en schep er doorheen. Zet het vuur uit van de pan met spekjes en spaghetti.', '4:\r\n\r\nVoeg de geraspte Parmezaanse kaas toe en voeg er een klein beetje pasta kookvocht aan toe, zodat de kaas smelt.', 'Kluts ondertussen de eieren en voeg ze daarna al roerend toe. Blijf roeren totdat het een romige saus.', 'Garneer de pasta carbonara eventueel met een beetje kaas en peterselie. Pasta carbonara is lekker met een frisse salade.', 'Zeven: \r\n\r\nLet op: Als de spaghetti te veel is afgekoeld, bindt de saus niet, maar als de spaghetti te heet is gaan de eieren stollen. Zet de pan daarom niet meer terug op het vuur.', 'Tip: voor een vegetarische variant kun je vegetarische spekjes gebruiken of ze vervangen door champignons of gezouten cashewnoten.', '', '', NULL, 'voor 2 personen', '25 minuten', '/src/assets/images/receptenboek/pastacarbonara/pasta1.png', 'null', '3', NULL, 2);
INSERT INTO `receptenboek` (`schrijver`, `Titel`, `recept_titel`, `receptIngredienten`, `recept_stap_1`, `recept_stap_2`, `recept_stap_3`, `recept_stap_4`, `recept_stap_5`, `recept_stap_6`, `recept_stap_7`, `recept_stap_8`, `recept_stap_9`, `recept_stap_10`, `datum`, `recept_voor_aantal_personen`, `bereidingstijdrecept`, `RECEPTFOTO1`, `receptfoto2`, `gemiddelde_review_score_recept`, `maximaal_aantal_calorieen`, `id`) VALUES
('Herman den Blijker', 'Burrito met kip, 35 minuten bereidingstijd, voor twee personen', 'Burrito met kip, 35 minuten bereidingstijd, voor twee personen', '4 grote tortilla wraps, 200 gr bonen, 160 gr stukjes kip (vegetarisch), 1 klein kropje sla, 100 ml tomatensaus, 1 teen knoflook, 1 kleine ui, 70 gr maïs, 1 paprika, handje geraspte kaas, 0.5 eetlepel burrito of Mexicaanse kruiden, 100 gr rijst, 125 ml zure room', 'Stap 1: Bereid de rijst\r\n\r\nSpoel de rijst grondig af onder koud water.\r\nBreng 200 ml water aan de kook in een pan.\r\nVoeg de rijst toe aan het kokende water en laat het sudderen op laag vuur tot al het water is opgenomen en de rijst gaar is, volg de instructies op de verpakking.\r\nHaal de pan van het vuur en laat de rijst afgedekt rusten.', 'Stap 2: Bereid de vulling\r\n\r\nSnijd de ui, knoflook en paprika fijn.\r\nVerhit wat olie in een pan op middelhoog vuur en voeg de gesneden ui en knoflook toe. Bak tot ze zacht en lichtbruin zijn.\r\nVoeg de paprika toe en bak deze tot hij zacht wordt.\r\nVoeg de stukjes kip (of vegetarische kip) toe aan de pan en bak ze tot ze gaar zijn.\r\nVoeg vervolgens de bonen en maïs toe aan de pan en verwarm alles door.\r\nBreng op smaak met de burrito- of Mexicaanse kruiden.', 'Stap 3: Bereid de wraps\r\n\r\nVerwarm de tortilla wraps kort in een droge koekenpan of magnetron om ze zachter te maken.\r\nVerdeel de bereide rijst gelijkmatig over de wraps.\r\nSchep het bonen-kipmengsel op de rijst.', 'Stap 4: Monteer de burrito\'s\r\n\r\nLeg een paar blaadjes sla bovenop het bonen-kipmengsel.\r\nLepel wat tomatensaus en zure room over de vulling.\r\nBestrooi elk burrito met een beetje geraspte kaas.', 'Stap 5: Vouw de burrito\'s\r\n\r\nVouw eerst de zijkanten van de tortilla naar binnen en rol deze vervolgens strak op vanaf de onderkant, zodat de vulling goed is ingesloten.', 'Stap 6: Serveer\r\n\r\nSnijd de burrito\'s doormidden en serveer ze warm.\r\nJe kunt ze serveren met extra zure room, salsa, guacamole of verse kruiden naar keuze.\r\nGeniet van je zelfgemaakte burrito\'s!', '', '', '', '', NULL, 'voor 2 personen', '30 minuten', '.base64 {\r\n  background-image: url(\"data:image/png;base64,', '', '2', NULL, 3);

