INSERT INTO `stappen` (`stap1`, `stap2`, `stap3`, `stap4`, `stap5`, `stap6`, `stap7`, `stap8`) VALUES
('Schil de aardappels en snijd grote aardappels in tweeën.', 'Doe de boerenkool en aardappels in een pan en voeg water toe totdat alles goed onderstaat. Breng het geheel aan de kook en kook de aardappels en boerenkool ongeveer 20 minuten totdat de aardappels gaar zijn.', 'Bereid de rookworst volgens de verpakking. Zelf kook ik de rookworst mee in de pan met de aardappels en boerenkool.', 'Bak ondertussen in een andere pan de spekblokjes bruin en krokant, zonder olie toe te voegen.', 'Na ongeveer 20 minuten zijn de aardappels gaar, en giet je het geheel af. Stamp de aardappels met de boerenkool, een snufje zout en peper, azijn en de boter fijn (evt. kun je de azijn ook weglaten). Als de stamppot nog wat te droog is, voeg je een beetje ', 'Schep als laatste de spekblokjes (met het vet) door de boerenkool stamppot en serveer het geheel met de rookworst.\r\n\r\nSchep als laatste de spekblokjes (met het vet) door de boerenkool stamppot en serveer het geheel met de rookworst.', '', ''),
('1. Doe de spekblokjes in een pan en bak ze mooi krokant. Ze hoeven niet helemaal uitgebakken te worden.', 'twee Zet ondertussen een grote pan water met een snufje zout op het vuur en als het water kookt voeg je de spaghetti toe. Kook de spaghetti in ongeveer 10 min al dente (of check de verpakking voor de bereidingswijze).', 'drei\r\n\r\nVoeg de pasta direct uit de pan waarin je het hebt gekookt toe aan de pan met spekjes toe en schep er doorheen. Zet het vuur uit van de pan met spekjes en spaghetti.', '4:\r\n\r\nVoeg de geraspte Parmezaanse kaas toe en voeg er een klein beetje pasta kookvocht aan toe, zodat de kaas smelt.', 'Kluts ondertussen de eieren en voeg ze daarna al roerend toe. Blijf roeren totdat het een romige saus.', 'Garneer de pasta carbonara eventueel met een beetje kaas en peterselie. Pasta carbonara is lekker met een frisse salade.', 'Zeven: \r\n\r\nLet op: Als de spaghetti te veel is afgekoeld, bindt de saus niet, maar als de spaghetti te heet is gaan de eieren stollen. Zet de pan daarom niet meer terug op het vuur.', 'Tip: voor een vegetarische variant kun je vegetarische spekjes gebruiken of ze vervangen door champignons of gezouten cashewnoten.'),
('Stap 1: Bereid de rijst\r\n\r\nSpoel de rijst grondig af onder koud water.\r\nBreng 200 ml water aan de kook in een pan.\r\nVoeg de rijst toe aan het kokende water en laat het sudderen op laag vuur tot al het water is opgenomen en de rijst gaar is, volg de instru', 'Stap 2: Bereid de vulling\r\n\r\nSnijd de ui, knoflook en paprika fijn.\r\nVerhit wat olie in een pan op middelhoog vuur en voeg de gesneden ui en knoflook toe. Bak tot ze zacht en lichtbruin zijn.\r\nVoeg de paprika toe en bak deze tot hij zacht wordt.\r\nVoeg de ', 'Stap 3: Bereid de wraps\r\n\r\nVerwarm de tortilla wraps kort in een droge koekenpan of magnetron om ze zachter te maken.\r\nVerdeel de bereide rijst gelijkmatig over de wraps.\r\nSchep het bonen-kipmengsel op de rijst.', 'Stap 4: Monteer de burrito\'s\r\n\r\nLeg een paar blaadjes sla bovenop het bonen-kipmengsel.\r\nLepel wat tomatensaus en zure room over de vulling.\r\nBestrooi elk burrito met een beetje geraspte kaas.', 'Stap 5: Vouw de burrito\'s\r\n\r\nVouw eerst de zijkanten van de tortilla naar binnen en rol deze vervolgens strak op vanaf de onderkant, zodat de vulling goed is ingesloten.', 'Stap 6: Serveer\r\n\r\nSnijd de burrito\'s doormidden en serveer ze warm.\r\nJe kunt ze serveren met extra zure room, salsa, guacamole of verse kruiden naar keuze.\r\nGeniet van je zelfgemaakte burrito\'s!', '', '');

